css:
atom-text-editor,
:host {
  background: radial-gradient(ellipse at center, #000000 0%, #001000 90%);
  color: #00e000;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #003400;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #002200;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #003400;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #001100;
  color: #00e000;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #002200;
  color: #00ff00;
  text-shadow: 0px 0px 5px rgba(0, 255, 0, 0.5);
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #00ff00;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #008c00;
}
atom-text-editor .invisible,
:host .invisible {
  color: #00e000;
}
atom-text-editor .cursor,
:host .cursor {
  color: #00ff00;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #036303;
  background: repeating-linear-gradient(0deg, #000000, #000000 1px, #036303 2px, #036303 1px);
  border-right: 2px solid #005600;
  border-left: 2px solid #005600;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #008c00 !important;
}
atom-text-editor::shadow .find-result .region {
  background-color: transparent;
  border: none;
  outline: 1px solid #008c00;
  outline-offset: 1px;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #003400;
}
.comment {
  color: #008c00;
}
.entity.name.type {
  color: #00ff00;
  font-weight: bold;
  text-shadow: 0px 0px 5px rgba(0, 255, 193, 0.8);
}
.entity.other.inherited-class {
  color: #00e000;
}
.keyword {
  color: #00e09d;
  text-shadow: 0px 0px 5px rgba(0, 255, 193, 0.5);
}
.keyword.control {
  color: #00e000;
}
.keyword.operator {
  color: #00b95b;
}
.keyword.key {
  color: #00cb76;
}
.keyword.class {
  color: #00ac63;
}
.keyword.assignment {
  color: #46ff90;
  text-shadow: 0px 0px 10px #64ff64;
}
.keyword.comparison {
  color: #46ff90;
  text-shadow: 0px 0px 10px #64ff64;
}
.keyword.logical {
  color: #46ff90;
  text-shadow: 0px 0px 10px #64ff64;
}
.keyword.other.special-method {
  color: #00e000;
}
.keyword.other.unit {
  color: #00e000;
}
.storage {
  color: #08ed8d;
}
.constant {
  color: #08ed8d;
}
.constant.character.escape {
  color: #89de00;
}
.constant.numeric {
  color: #08ed8d;
}
.constant.other.color {
  color: #00e09d;
}
.constant.other.symbol {
  color: #00e09d;
}
.variable {
  color: #00ff33;
  border-bottom: 1px dashed #003400;
}
.variable.interpolation {
  color: #00ad00;
}
.variable.parameter.function {
  color: #00e000;
}
.invalid.illegal {
  background-color: #ff0000;
  color: #000000;
}
.string {
  color: #89de00;
  text-shadow: 0px 5px 5px rgba(100, 255, 100, 0.2);
}
.string.regexp {
  color: #89de00;
}
.string.regexp .source.ruby.embedded {
  color: #89de00;
}
.string.other.link {
  color: #89de00;
}
.punctuation.definition.comment {
  color: #006f00;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #00e000;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #83ff83;
}
.punctuation.definition.bold {
  color: #00e000;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #00e000;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #00ad00;
}
.support.class {
  color: #00ff00;
  font-weight: 400;
  text-shadow: 0px 0px 7px rgba(150, 255, 150, 0.7);
}
.support.function {
  color: #00ff00;
  text-shadow: 0px 0px 7px rgba(150, 255, 150, 0.7);
}
.support.function.any-method {
  color: #00ff00;
  text-shadow: 0px 0px 7px rgba(150, 255, 150, 0.7);
}
.entity.name.function {
  color: #83ff83;
}
.entity.name.class,
.entity.name.type.class {
  color: #83ff83;
}
.entity.name.section {
  color: #83ff83;
}
.entity.name.tag {
  color: #83ff83;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #00b95b;
}
.entity.other.attribute-name.id {
  color: #83ff83;
}
.meta.class {
  color: #00b95b;
}
.meta.link {
  color: #00b95b;
}
.meta.require {
  color: #00b95b;
}
.meta.selector {
  color: #00b95b;
}
.meta.separator {
  background-color: #000000;
  color: #00e000;
}
.meta.function-call {
  color: #00e09d;
}
.none {
  color: #00e000;
}
.markup.bold {
  color: #00b95b;
  font-weight: bold;
}
.markup.changed {
  color: #00ff00;
}
.markup.deleted {
  color: #008c00;
}
.markup.italic {
  color: #00e000;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #00ff00;
}
.markup.inserted {
  color: #83ff83;
}
.markup.list {
  color: #00e000;
}
.markup.quote {
  color: #008c00;
}
.markup.raw.inline {
  color: #008c00;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #00ff00;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
  background-color: #000000;
}
